import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav } from 'react-bootstrap';

class NavLink extends React.Component {
  render() {
    return (
      <Nav className="AllLinks">
        <Nav.Link
          className="navLiks"
          eventKey={ 2 }
          href="/search"
        >
          Search
        </Nav.Link>
        <Nav.Link className="navLiks" eventKey={ 2 } href="/favorites">
          Favorites
        </Nav.Link>
        <Nav.Link className="navLiks" eventKey={ 2 } href="/profile">
          Profile
        </Nav.Link>
      </Nav>

    );
  }
}
export default NavLink;
